import React from 'react';
import {Link} from 'react-router-dom';
import './NavBar.css';

const NavBar = () => {
    return(
        <>
        <div className="logo">
            <ul>
                <li><Link to="/">Home</Link></li>
            </ul>
        </div>
        <div className="menu">
            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/recipes">Recipes</Link></li>
                <li><Link to="/new-recipe">+ New Recipe</Link></li>
            </ul>
        </div>
        </>
    )
}

export default NavBar;
